#include "network_evaluate.h"
#define soft_max_input 2
float class_output[soft_max_input];

float linear(float num) {
	return num;
}

float sigmoid(float num) {
	return 1 / (1 + exp(-num));
}

float relu(float num) {
	if (num > 0) {
		return num;
	}
	else {
		return 0;
	}
}

float softmax(float num[soft_max_input],int item){
	int i;
  float vertor1[soft_max_input];
	float sum=0;
	for (i = 0; i < soft_max_input; i++)
	{
		vertor1[i] = exp(num[i]);
		sum += vertor1[i];
	}
	class_output[item]=vertor1[item]/sum;
	return class_output[item];
	
}

